-- compamny number and charity number
/*
SELECT LegalName, UKPRN, 
JSON_VALUE([OrganisationData],'$.CompanyNumber') CompanyNumber,
JSON_VALUE([OrganisationData],'$.CharityNumber') CharityNumber
FROM  [Organisations] WHERE JSON_VALUE([OrganisationData],'$.CompanyNumber') IS NOT NULL
OR JSON_VALUE([OrganisationData],'$.CharityNumber') IS NOT NULL
*/

UPDATE [Organisations] SET [OrganisationData] = JSON_MODIFY([OrganisationData],'strict $.CompanyNumber', null ) 
WHERE JSON_VALUE([OrganisationData],'$.CompanyNumber') IS NOT NULL

UPDATE [Organisations] SET [OrganisationData] = JSON_MODIFY([OrganisationData],'strict $.CharityNumber', null ) 
WHERE JSON_VALUE([OrganisationData],'$.CharityNumber') IS NOT NULL


